emojiToFE0FMap = {}
for a in range(len(emojiToFE0F)):
    emojiToFE0FMap[emojiToFE0F[a]] = True

version = 13
size = 66
scale = 2.0
if len(sys.argv) > 1:
    kind = sys.argv[1]
else:
    kind = 'google'

infos = []

for x in range(len(sprites)):
    sprite = sprites[x]
    c = int(ceil(len(sprite) / 4.0))
    infos.append([])
    for j in range(len(sprite)):
        y = int(j / c)
        if (y > len(infos[x]) -1):
            infos[x].append([])
        i7 = j - (y * c)
        i8 = int(i7 % dimensions[x][y])
        i7 = int(i7 / dimensions[x][y])
        i9 = int(i8 * scale)
        i10 = int(i7 * scale)
        left = int((i8 * size) + i9)
        top = int((i7 * size) + i10)
        right = int(((i8 + 1) * size) + i9)
        bottom = int(((i7 + 1) * size) + i10)
        emoji = sprite[j]
        for a in range(len(emoji)):
            if ord(emoji[a]) in emojiToFE0F:
                if len(emoji) > 1:
                    emoji = emoji[:a] + '\uFE0F' + emoji[a]
                else:
                    emoji = emoji[a] + '\uFE0F'
        unified = ''
        for char in emoji:
            part = '{:x}'.format(ord(char))
            if (len(part) < 3):
                part = ("0" * (4 - len(part))) + part + "-fe0f"
            unified += f'-{part}'
        unified = re.sub(r'(-fe0f)+', r'-fe0f', unified)
        unified = unified[1:]
        infos[x][y].append({'unified':  unified,'width': (dimensions[x][y] * size),'height':(i7 * size),'sheet': f'v{version}_{x}_{y}', 'index': j, 'left': left, 'top': top, 'right': right, 'bottom': bottom})

notFound = 0
for sprite in infos:
    for sheet in sprite:
        original_img = Image.open(f'original/{sheet[0]["sheet"]}.png', 'r')
        img = Image.new('RGBA', original_img.size)
        for emoji in sheet:
            if DEBUG:
                d = ImageDraw.Draw(img)
                d.rectangle([int(emoji['left']), int(emoji['top']), int(emoji['left']) + size, int(emoji['top']) + size], fill=(255,255,255))
                d.text((int(emoji['left']), int(emoji['top'])), str(emoji['index']), fill=(255, 0, 0))
            try:
                if (kind == 'abomimoji'):
                    emoji_img = original_img.crop((int(emoji['left']), int(emoji['top']), int(emoji['left']) + size, int(emoji['top']) + size))
                    emoji_img = saint.nuke(emoji_img)
                else:
                    emoji_img = Image.open(f'emojidata/node_modules/emoji-datasource-{kind}/img/{kind}/64/{emoji["unified"]}.png', 'r')
                    emoji_img = emoji_img.resize((size, size))
            except FileNotFoundError as e:
                try:
                    unified = emoji["unified"].replace('-fe0f', '').replace('fe0f-', '')
                    emoji_img = Image.open(f'emojidata/node_modules/emoji-datasource-{kind}/img/{kind}/64/{unified}.png', 'r')
                    emoji_img = emoji_img.resize((size, size))
                except FileNotFoundError as e:
                    try:
                        unified = emoji["unified"].replace('-fe0f', '').replace('fe0f-', '')
                        emoji_img = Image.open(f'emojidata/node_modules/emoji-datasource-{kind}/img/{kind}/64/{unified}-fe0f.png', 'r')
                        emoji_img = emoji_img.resize((size, size))
                    except FileNotFoundError as e:
                        emoji_img = original_img.crop((int(emoji['left']), int(emoji['top']), int(emoji['left']) + size, int(emoji['top']) + size))
                        notFound += 1
                        print(f'No image found for {emoji["unified"]} in {kind}')
            img.paste(emoji_img, (int(emoji['left']), int(emoji['top']), int(emoji['left']) + size, int(emoji['top']) + size))
        filename = f'out/{sheet[0]["sheet"]}.png'
        img.save(filename, format='png')

print(f'{notFound} not found')

if DEBUG:
    with open('spriteinfo.json', 'w') as f:
        f.write(json.dumps(infos, sort_keys=True, indent=2, separators=(',', ': ')))
